import { Fragment } from "react";
import "./App.css";

function App() {
  const list = [
    {id: 1, text: "Перший елемент", link: "/first"},
    {id: 2, text: "Другий елемент", link: '/second'},
    {id: 3, text: "Третій елемент", link: '/last'},
  ];


  return (
    <div className="App">
      <header className="App-header">
          {list.map((item) => (

              <span key={item.id} className="App-link" onClick={handleClick(item.link)}>
                {item.text}
              </span>
          ))}
      </header>
    </div>
  );
}

export default App;
